void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    float ost=fragCoord.x-(100.0*floor(fragCoord.x/100.0));
    fragColor=vec4(0.0, 0.0, 0.0, 0.0);
    if (ost>70.0){
    fragColor.r=fragCoord.x*0.001;
    fragColor.b=fragCoord.x*0.001;
    }
    if (ost<70.0){
    fragColor.r=fragCoord.x*0.002*(cos(iTime));
    fragColor.b=0.002*fragCoord.x*(cos(iTime));
    }
}
